import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h1>Welcome to the App</h1>
      <div>
        <Link to="/register">
          <button type="submit">Register</button>
        </Link>
      </div>
      <div>
        <Link to="/login">
          <button type="submit">Login</button>
        </Link>
      </div>
      <div>
        <Link to="/posts">
          <button type="submit">Register</button>
        </Link>
      </div>
      <div>
        <Link to="/register">
          <button type="submit">Register</button>
        </Link>
      </div>
    </div>
  );
};

export default Home;
